import 'package:flutter_test/flutter_test.dart';
import 'package:http/http.dart' as http;
import 'package:image_search/data/pixabay_api.dart';
import 'package:mockito/annotations.dart';
import 'package:mockito/mockito.dart';

import 'pixabay_api_test.mocks.dart';

@GenerateMocks([http.Client])
void main() {
  test('Pixabay data must be fetched properly.', () async {
    final pixabayApi = PixabayApi();

    final client = MockClient();

    when(
      client.get(
        Uri.parse(
          '${PixabayApi.baseUrl}?key=${PixabayApi.key}&q=apple&image_type=photo',
        ),
      ),
    ).thenAnswer((_) async => http.Response(fakeJsonBody, 200));

    final result = await pixabayApi.fetch('apple', client: client);

    expect(result.first.id, 1702316);
    expect(result.length, 20);

    verify(
      client.get(
        Uri.parse(
          '${PixabayApi.baseUrl}?key=${PixabayApi.key}&q=apple&image_type=photo',
        ),
      ),
    );
  });
}

